import './App.css';
import {BrowserRouter, Routes, Route}  from "react-router-dom";
import Add from './pages/add';
import Notes from './pages/Notes';

function App() {






  return (
    <div className="App">
        <BrowserRouter>
      <Routes>
        <Route path="/" element={<Notes/>} /> 
        <Route path="/notes" element={<Notes/>} />
        <Route path="/add" element={<Add/>} />

      </Routes>

     </BrowserRouter>
    </div>
  );
}

export default App;
